import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div className="jumbotron jumbotron-fluid jumbo-height">
        <div className="container">
          <h1 className="display-3">
            <strong>JVA Aesthetics </strong>
          </h1>
          <p className="lead">
            This is a modified jumbotron that occupies the entire horizontal
            space of its parent.
          </p>
          <img
            src="img/optimus.jpg"
            className="rounded-circle img-size img-fluid"
          />
        </div>
      </div>
    );
  }
}

export default Home;
